import React from 'react';

const CELL_SIZE = 20;

const Cell = React.forwardRef((props,  ref) => 
{
  const { x, y } = props;

  console.log(ref);

  return (<div className="Cell"
    style={{
    left: `${CELL_SIZE * x + 1}px`,
    top: `${CELL_SIZE * y + 1}px`,
    width: `${CELL_SIZE - 1}px`,
    height: `${CELL_SIZE - 1}px`}}
    ref={ref} />);
});

export default Cell;
